B.X0=new A.a6("Assessments",null,B.hl,null,null,null,null)
B.X1=new A.a6("If you noticed your pain was eliminated (or significantly decreased) with the core braced before extending the weight, we can assume your body has an instability problem and the loads you are lifting are leading to your pain. Learning to stiffen your body with purposeful core stability exercises will be key for your recovery.",null,null,null,null,null,null)
B.X2=new A.a6("Research has shown that the rotation of the hips (especially a lack or difference side to side in internal rotation) is a large factor in the development of back pain. If an athlete has a significant deficit in internal rotation on one side of the body, the low back will sustain uneven forces as the body drops into the bottom position of a squat, clean or snatch.",null,null,null,null,null,null)
